import React from "react";

const ResumePage = () => {
  return (
    <div className="resume-container">
      <h1>Резюме проекту</h1>
      <div className="ots">
        <p>
          <strong>Назва проекту:</strong> Назва вашого проекту
        </p>
        <p>
          <strong>Виконав:</strong> Бак Роман
        </p>
        <p>студент 3 курсу</p>
        <p>групи 6.04.122.010.21.2</p>
        <p>факультету ІТ</p>
        <p>Бак Р.С.</p>
      </div>
    </div>
  );
};

export default ResumePage;
